    <div className="four wide column">
      {/* key={url} */}
        <div className="ui link cards">
          <div className="card">
            <div className="content">
              <h1>Hello</h1>
              <div className="header">{character.name}</div>
                {/* <div className="meta price">{gender}</div>
                 <div className="meta">{born}</div> */}
               </div>
            </div>
          </div>
        </div>
  );
  });

  return 
  <>{renderList}</>;
  
}

